{
  "env": {
    "node": true,
    "browser": true,
    "es6": true
  },
  "settings": {
    "react": {
      "version": "detect"
    },
    "import/parsers": {
      "@typescript-eslint/parser": [".ts", ".tsx"]
    },
    "import/resolver": {
      "node": true,
      "typescript": {
        "alwaysTryTypes": true,
        "project": ["packages/*/tsconfig.json"]
      }
    }
  },
  "parser": "@typescript-eslint/parser",
  "plugins": [
    "react",
    "@typescript-eslint",
    "prettier",
    "@next/eslint-plugin-next",
    "no-async-foreach"
  ],
  "extends": [
    "eslint:recommended",
    "plugin:import/recommended",
    "plugin:import/typescript",
    "plugin:react/recommended",
    "plugin:@typescript-eslint/eslint-recommended",
    "plugin:@typescript-eslint/recommended",
    "plugin:prettier/recommended",
    "plugin:@next/eslint-plugin-next/recommended",
    "plugin:react-hooks/recommended"
  ],
  "parserOptions": {
    "ecmaFeatures": {
      "jsx": true
    },
    "ecmaVersion": 2018,
    "sourceType": "module"
  },
  "globals": {
    "Atomics": "readonly",
    "SharedArrayBuffer": "readonly"
  },
  "rules": {
    "no-unused-expressions": [
      "error",
      {
        "allowShortCircuit": true,
        "enforceForJSX": true,
        "allowTernary": true
      }
    ],
    "no-async-foreach/no-async-foreach": 2,
    "@next/next/no-html-link-for-pages": ["warn", "./packages/front-end/pages"],
    "@next/next/no-img-element": "off",
    "@typescript-eslint/explicit-module-boundary-types": "off",
    "@typescript-eslint/explicit-function-return-type": "off",
    "@typescript-eslint/no-explicit-any": 1,
    "@typescript-eslint/no-inferrable-types": [
      "warn",
      {
        "ignoreParameters": true
      }
    ],
    "@typescript-eslint/no-unused-vars": [
      "warn",
      {
        "argsIgnorePattern": "^_"
      }
    ],
    "no-console": ["warn"],
    "no-restricted-imports": "off",
    "react/react-in-jsx-scope": "off",
    "react/prop-types": "off",
    "react-hooks/rules-of-hooks": "error",
    "react-hooks/exhaustive-deps": "warn",
    "import/order": [
      "error",
      {
        "groups": [
          "builtin",
          "external",
          "internal",
          "parent",
          "sibling",
          "index",
          "unknown"
        ]
      }
    ],
    "@typescript-eslint/prefer-ts-expect-error": "error"
  },
  "overrides": [
    {
      "files": [
        "./packages/sdk-js/rollup.config.js",
        "./packages/sdk-react/rollup.config.js"
      ],
      "rules": {
        "import/no-named-as-default": "off"
      }
    },
    {
      "files": [
        "./packages/back-end/src/**/*.ts*",
        "./packages/back-end/types/**/*.ts*",
        "./packages/front-end/**/*.ts*"
      ],
      "rules": {
        "no-restricted-imports": ["error", { "patterns": ["..*"] }]
      }
    },
    {
      "files": ["./packages/front-end/**/*.ts*"],
      "excludedFiles": ["./packages/front-end/components/Radix/**/*.ts*"],
      "rules": {
        "no-restricted-imports": [
          "error",
          {
            "paths": [
              {
                "name": "@radix-ui/themes",
                "message": "Use the component from @/components/Radix/ instead.",
                "importNames": [
                  "Avatar",
                  "Badge",
                  "Button",
                  "Callout",
                  "Checkbox",
                  "DataList",
                  "DropdownMenu",
                  "Link",
                  "RadioCards",
                  "RadioGroup",
                  "Select",
                  "Tabs"
                ]
              }
            ]
          }
        ]
      }
    },
    {
      "files": [
        "./packages/docs/pages/_app.tsx",
        "./packages/front-end/components/Auth/InAppHelp.tsx",
        "./packages/front-end/components/Dimensions/DimensionChooser.tsx",
        "./packages/front-end/components/Experiment/ImportExperimentModal.tsx",
        "./packages/front-end/components/Experiment/ManualSnapshotForm.tsx",
        "./packages/front-end/components/Experiment/NewExperimentForm.tsx",
        "./packages/front-end/components/Experiment/VisualEditorScriptMissing.tsx",
        "./packages/front-end/components/Features/CodeSnippetModal.tsx",
        "./packages/front-end/components/Features/DraftModal.tsx",
        "./packages/front-end/components/Features/RuleList.tsx",
        "./packages/front-end/components/Forms/SelectField.tsx",
        "./packages/front-end/components/HomePage/NorthStar.tsx",
        "./packages/front-end/components/Markdown/MarkdownInput.tsx",
        "./packages/front-end/components/Metrics/MetricForm.tsx",
        "./packages/front-end/components/ProtectedPage.tsx",
        "./packages/front-end/components/Queries/RunQueriesButton.tsx",
        "./packages/front-end/components/Segments/PickSegmentModal.tsx",
        "./packages/front-end/components/Settings/UpgradeModal.tsx",
        "./packages/front-end/components/Share/ShareModal.tsx",
        "./packages/front-end/components/Tabs/ControlledTabs.tsx",
        "./packages/front-end/components/TempMessage.tsx",
        "./packages/front-end/hooks/useStripeSubscription.ts",
        "./packages/front-end/pages/experiments/index.tsx",
        "./packages/front-end/pages/idea/*iid*.tsx",
        "./packages/front-end/pages/index.tsx",
        "./packages/front-end/pages/integrations/vercel/index.tsx",
        "./packages/front-end/pages/invitation.tsx",
        "./packages/front-end/pages/metric/*mid*.tsx",
        "./packages/front-end/pages/oauth/callback.tsx",
        "./packages/front-end/pages/report/*rid*.tsx",
        "./packages/front-end/pages/reports.tsx",
        "./packages/front-end/pages/settings/index.tsx",
        "./packages/front-end/pages/settings/team.tsx",
        "./packages/front-end/services/DefinitionsContext.tsx",
        "./packages/front-end/services/features.ts",
        "./packages/front-end/services/search.tsx",
        "./packages/front-end/services/useGlobalMenu.ts",
        "./packages/front-end/services/useSwitchOrg.ts"
      ],
      "rules": {
        "react-hooks/exhaustive-deps": "off"
      }
    },
    {
      "rules": {
        "no-console": "off"
      },
      "files": [
        "./packages/sdk-js/**/*",
        "./packages/front-end/**/*",
        "./packages/back-end/test/**/*",
        "./packages/back-end/src/scripts/**/*",
        "./packages/back-end/**/*.test.{ts,tsx,js,jsx}"
      ]
    }
  ]
}

module.exports = function (plop) {
  // region Back-end

  plop.setGenerator("router", {
    description: "[back-end] Generates a router and controller",
    prompts: [
      {
        type: "input",
        name: "resource",
        message:
          "What is the name of the resource? Use the singular form, e.g. event for API GET /event",
      },
    ],
    actions: [
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/routers/{{kebabCase resource}}/{{kebabCase resource}}.router.ts",
        templateFile: "./plop-templates/back-end/router.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/routers/{{kebabCase resource}}/{{kebabCase resource}}.controller.ts",
        templateFile: "./plop-templates/back-end/controller.hbs",
      },
    ],
  });

  // endregion Back-end

  // region Front-end

  plop.setGenerator("component", {
    description: "[front-end] Generates a component",
    prompts: [
      {
        type: "input",
        name: "component",
        message: "What should the name of the component be?",
      },
    ],
    actions: [
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/front-end/components/{{pascalCase component}}/{{pascalCase component}}.tsx",
        templateFile: "./plop-templates/front-end/component.hbs",
      },
    ],
  });

  plop.setGenerator("api-object", {
    description: "[back-end] Generate REST API list and get endpoints",
    prompts: [
      {
        type: "input",
        name: "object",
        message:
          "The singular name of the API object (e.g. 'metric' or 'data source')",
      },
    ],
    actions: [
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/{{kebabCase object}}s/{{kebabCase object}}s.router.ts",
        templateFile: "./plop-templates/back-end/api/router.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/{{kebabCase object}}s/list{{pascalCase object}}s.ts",
        templateFile: "./plop-templates/back-end/api/list.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/{{kebabCase object}}s/get{{pascalCase object}}.ts",
        templateFile: "./plop-templates/back-end/api/get.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/{{kebabCase object}}s/post{{pascalCase object}}.ts",
        templateFile: "./plop-templates/back-end/api/post.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/{{kebabCase object}}s/update{{pascalCase object}}.ts",
        templateFile: "./plop-templates/back-end/api/update.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/{{kebabCase object}}s/delete{{pascalCase object}}.ts",
        templateFile: "./plop-templates/back-end/api/delete.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/openapi/schemas/{{pascalCase object}}.yaml",
        templateFile: "./plop-templates/back-end/api/openapi_model.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/openapi/paths/list{{pascalCase object}}s.yaml",
        templateFile: "./plop-templates/back-end/api/openapi_list.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/openapi/paths/post{{pascalCase object}}.yaml",
        templateFile: "./plop-templates/back-end/api/openapi_post.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/openapi/paths/update{{pascalCase object}}.yaml",
        templateFile: "./plop-templates/back-end/api/openapi_update.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/openapi/paths/get{{pascalCase object}}.yaml",
        templateFile: "./plop-templates/back-end/api/openapi_get.hbs",
      },
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/back-end/src/api/openapi/paths/delete{{pascalCase object}}.yaml",
        templateFile: "./plop-templates/back-end/api/openapi_delete.hbs",
      },
      {
        type: "append",
        path: "./packages/back-end/src/api/openapi/schemas/_index.yaml",
        template: `
{{pascalCase object}}:
  $ref: './{{pascalCase object}}.yaml'
`.trim(),
      },
      {
        type: "append",
        path: "./packages/back-end/src/api/openapi/openapi.yaml",
        pattern: /PLOP_INSERT_PATHS_HERE/,
        template: `  /{{kebabCase object}}s:
    get:
      $ref: "./paths/list{{pascalCase object}}s.yaml"
    post:
      $ref: "./paths/post{{pascalCase object}}.yaml"
  /{{kebabCase object}}s/{id}:
    get:
      $ref: "./paths/get{{pascalCase object}}.yaml"
    post:
      $ref: "./paths/update{{pascalCase object}}.yaml"
    delete:
      $ref: "./paths/delete{{pascalCase object}}.yaml"`,
      },
    ],
  });

  plop.setGenerator("next-page", {
    description: "[front-end] Generates a Next.js page",
    prompts: [
      {
        type: "input",
        name: "route",
        message:
          "What is the path this should live? e.g. settings/webhooks/[eventwebhookid] if you want to create the file settings/webhooks/[eventwebhookid].tsx",
      },
      {
        type: "input",
        name: "pageName",
        message:
          "What is the name of this page? This is used internally in the file and will have a `Page` suffix, e.g. EventWebHookDetail will be EventWebHookDetailPage",
      },
    ],
    actions: [
      {
        type: "add",
        skipIfExists: true,
        path: "./packages/front-end/pages/{{route}}.tsx",
        templateFile: "./plop-templates/front-end/next-page.hbs",
      },
    ],
  });

  // endregion Front-end

  // region Shared

  plop.setGenerator("shared-entrypoint", {
    description: "[shared] Generates a new entry point for the shared package",
    prompts: [
      {
        type: "input",
        name: "entrypoint",
        message:
          "A new entry point for the shared package, e.g. 'todos' to make import { createTodo } from 'shared/todos'",
      },
      {
        type: "input",
        name: "function",
        message:
          "Name of the first function to add to this file, e.g. 'createTodo' to make import { createTodo } from 'shared/todos'",
      },
    ],
    actions: [
      // definition file
      {
        type: "add",
        skipIfExists: true,
        path: "./packages/shared/{{kebabCase entrypoint}}.d.ts",
        template: `export * from "./src/{{kebabCase entrypoint}}";`.trim(),
      },
      // utils
      {
        type: "add",
        skipIfExists: true,
        path:
          "./packages/shared/src/{{kebabCase entrypoint}}/{{kebabCase entrypoint}}.ts",
        template: `export function {{function}}(): void {
  // todo
}`.trim(),
      },
      // exports & barrel files
      {
        type: "add",
        skipIfExists: true,
        path: "./packages/shared/{{kebabCase entrypoint}}.js",
        template: `module.exports = require("./dist/{{kebabCase entrypoint}}");`.trim(),
      },
      {
        type: "add",
        skipIfExists: true,
        path: "./packages/shared/src/{{kebabCase entrypoint}}/index.ts",
        template: `export * from "./{{kebabCase entrypoint}}";`.trim(),
      },
      {
        type: "append",
        path: "./packages/shared/src/index.ts",
        template: `export * as {{camelCase entrypoint}} from "./{{kebabCase entrypoint}}";`.trim(),
      },
    ],
  });

  // endregion Shared
};
